var modyo_alert_counter = 0;

function flashMessage() {
  var Timer = function(callback, delay) {
    var timerId;
    var start;
    var remaining = delay;

    this.pause = function() {
      window.clearTimeout(timerId);
      remaining -= new Date() - start;
    };

    this.resume = function() {
      start = new Date();
      window.clearTimeout(timerId);
      timerId = window.setTimeout(callback, remaining);
    };
    this.resume();
  };
  function nukeCookie(cookieName) {
    var yesterday = new Date();
    var hostParts = window.location.hostname.split('.').reverse();
    var expireHost = hostParts.shift();

    yesterday.setDate(yesterday.getDate() - 1);

    hostParts.forEach(function(part) {
      expireHost = part + '.' + expireHost;
      document.cookie = cookieName + '=; path=/; expires=' + yesterday + '; domain=' + expireHost;
    });
    document.cookie = cookieName + '=; path=/; expires=' + yesterday + '; domain=';
  }

  function recalculateMargin() {
    var marginBase = 20;
    var marginExtra = 45;
    $('.modyo-site-alert').each(function(index) {
      var margin = (marginExtra * index) + marginBase;
      $(this).css('margin-top', margin + 'px');
    });
  }

  if(typeof Cookies.get('flash') !== 'undefined' && Cookies.get('flash').length > 0) {
    var str = Cookies.get('flash');
 		var cookies = JSON.parse(str).map(function(item) {
               var obj = {
                    type: item[0],
                    msg: item[1].replace(/\+/g, ' ')
               }
               return obj;
    });
    cookies.forEach(function(cookie, index, array) {
      var this_counter = modyo_alert_counter;
      var modal = '<div class="modyo-site-alert modyo-site-alert-' + cookie.type + ' modyo-site-alert-' + this_counter + ' ">';
                    modal += '<a class="modyo-site-alert-close" href="#">';
                    modal += '<svg style="width:16px;height:16px" viewBox="0 0 24 24">';
                    modal += '<path fill="#000000" d="M19,6.41L17.59,5L12,10.59L6.41,5L5,6.41L10.59,12L5,17.59L6.41,19L12,13.41L17.59,19L19,17.59L13.41,12L19,6.41Z" />';
                    modal += '</svg>';
                    modal += '</a>';
                    modal += cookie.msg;
                    modal += '</div>';
      $('#modyo-site-alert-wrapper').prepend(modal).find('.modyo-site-alert-' + this_counter).addClass('modyo-site-alert-open');
      recalculateMargin();
      $('.modyo-site-alert-close').on('click', function(e) {
        e.preventDefault();
        $(this).parent().remove();
        recalculateMargin();
        return false;
      });

      var timer = new Timer(function() {
        $('.modyo-site-alert-' + this_counter).remove();
        recalculateMargin();
      }, 5000);

      $('.modyo-site-alert-' + this_counter).on('mouseover', function() {
        timer.pause();
      });
      // Do some stuff...
      $('.modyo-site-alert-' + this_counter).on('mouseleave', function() {
        timer.resume();
      });
      modyo_alert_counter++;
    });
    nukeCookie('flash');
  }
}

$(document).ready(function() {
  flashMessage();
});
 


$( document ).ready(function() {
    jQuery(document.body).on("click", ":not(#calculator, #calculator *)", function(e){ 
				if($(this).attr('class') == 'modal-backdrop fade in'){
					$('.modal').modal('toggle');
				}
		});
});


var url = document.location.toString();
if (url.match('#')) {
    $('.nav-tabs a[href="#' + url.split('#')[1] + '"]').tab('show');
} 

// Change hash for page-reload
$('.nav-tabs a').on('shown.bs.tab', function (e) {
    window.location.hash = e.target.hash;
		window.scrollTo(0, 0);
});


