const mixinPresale = {
    data: function () {
          return {

          }
    },
    methods: {
          getReleaseDate: function(date) {
              //date = this.formatDate(date);
              var newDate = new Date(date);
              newDate = new Date(newDate.valueOf() + newDate.getTimezoneOffset() * 60000);
              newDate.setHours(0,0,0,0);
              return newDate;
          },
          getToday: function(){
              var today = new Date();
              today.setHours(0,0,0,0);
              return today;
          },
          getNextThursdayDate: function(){
              var dayOfWeek = 4;//jueves
              var today = this.getToday();
              if (today.getDay() == dayOfWeek) today.setDate(today.getDate() + 7);
              else today.setDate(today.getDate() + (dayOfWeek + 7 - today.getDay()) % 7);
              return today;
          },
          getLastThursdayDate: function(now) {
              var lastThursday = now;
              var lastDay = now;
              if (lastThursday.getDay() != 4) {
                    for (var i = 7; i >= 0; i--) {
                        var nextDay = lastDay.setDate(lastDay.getDate() - 1);
                        lastDay = new Date(nextDay);

                        if (lastDay.getDay() == 4) {
                              lastThursday = lastDay
                              break;
                        }
                    }
              }
              return lastThursday;
          },
          checkDebut: function(movie) {
              var check = false;
              var today = this.getToday();
              if (movie.opening_date) {
                    var release_date = this.getReleaseDate(movie.opening_date);
                    if(release_date >= this.getLastThursdayDate(today) && release_date < this.getNextThursdayDate()){
                        check = true;
                    }
              }
              return check;
          },
          calculatePresale: function (movie) {
              var openingDate = movie.opening_date;
              var check = false;
              if (openingDate) {
                    var release_date = this.getReleaseDate(openingDate);
                    if(release_date >= this.getNextThursdayDate()){
                        check = true;
                    }
              }
              return check;
          },
          calculateDaysPresale: function (day) {
              var openingDate = day.date + "T00:00:00";
              var check = false;
              if (openingDate) {
                    var release_date = this.getReleaseDate(openingDate);
                    if(release_date >= this.getNextThursdayDate()){
                        check = true;
                    }
              }
              return check;
          }
    }
};
													 
