          calculateDistance: function(origin_lat, origin_lng, target_lat, target_lng){
               var earth_radius = 6371;
               var dLat = this.degToRad(origin_lat - target_lat);
               var dLon = this.degToRad(origin_lng - target_lng);
               var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
                    Math.cos(this.degToRad(target_lat)) * Math.cos(this.degToRad(origin_lng)) *
                    Math.sin(dLon/2) * Math.sin(dLon/2);
               var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
               return earth_radius * c;
          },
