          storeData : function(cache_key, datas){
               if (!this.testLocalStorageBrowser())
                    this.noLocalStorageBrowser();
               else
                    sessionStorage.setItem(cache_key, JSON.stringify(datas));
          },
          recoverData : function(cache_key){
               if (!this.testLocalStorageBrowser()) {
                    this.noLocalStorageBrowser();
                    return null;
               } else {
                    var data = sessionStorage.getItem(cache_key);
                    return (data != 'undefined') ? JSON.parse(data) : null;
               }
          },
          dropData: function(cache_key) {
               if (!this.testLocalStorageBrowser())
                    this.noLocalStorageBrowser();
               else
                    sessionStorage.removeItem(cache_key);
          },
          testLocalStorageBrowser: function (){
               var testKey = 'testLocalStorage';
               var _return = true;
               try {
                    sessionStorage.setItem(testKey, '1');
                    sessionStorage.removeItem(testKey);
               } catch (error) {
                    _return = false;
               }
               return _return;
          },
          noLocalStorageBrowser: function(){
               alert('Cinemark Per no cuenta con soporte para navegacin privada. Se recomienda pasar a navegacin normal y cargar el sitio nuevamente.');
          },
          getTheatreTag: function () {
               var params = this.getAllParams();
               var tag = (params['tag']) ? params['tag']: undefined;

               if(!tag){
                    try {
                         return this.recoverData('current_theatre').id;
                    } catch (e) {
                         return GLOBAL_CONFIG.default_theatre_id;
                    }
               } else {
                    return tag;
               }
          },
          getSpecificParam: function (param) {
               var params = this.getAllParams();
               return (params[param] != null) ? params[param] : '';
          },
          getAllParams: function () {
               var queries = {};
               $.each(document.location.search.substr(1).split('&'), function (c, q) {
                    var i = q.split('=');
                    if (i != '') {
                         queries[i[0].toString()] = unescape(i[1].toString()); // change escaped characters in actual format
                    }
               });
               return queries;
          },
          gotoTheatre: function(theatre){
               var completeUrl = this.getUrl();
               var newUrl = completeUrl.origin + completeUrl.pathname;
               window.location.href = newUrl + "?tag=" + theatre.id;
          },
          clearSessionStorage: function () {
               sessionStorage.clear();
          },
