const mixinDate = {
    data: function () {
          return {

          }
    },
    methods: {
          convertDate: function(date, inputFormat, outputFormat, withTimeZone) {
              // if inputFormat is '' or null, moment try identify format.
              outputFormat  =  outputFormat || 'ddd DD MMM YYYY - hh:mmA';
              inputFormat = inputFormat || '';
              var output = date;
              moment.locale('es');
              if(withTimeZone) {
                    moment.tz.add("America/Lima|LMT -05 -04|58.A 50 40|0121212121212121|-2tyGP.o 1bDzP.o zX0 1aN0 1cL0 1cN0 1cL0 1PrB0 zX0 1O10 zX0 6Gp0 zX0 98p0 zX0|11e6");
                    output = moment(date, inputFormat).tz("America/Lima").format(outputFormat).toUpperCase();
              } else {
                    output = moment(date, inputFormat).format(outputFormat).toUpperCase();
              }

              return output;
          },
          formatDateYearMonthDay: function(date) {
              var dd = date.getDate();
              var mm = date.getMonth() + 1;
              var yyyy = date.getFullYear();
          
              dd = (dd<10) ? '0' + dd : dd;
              mm = (mm<10) ? '0' + mm : mm;
              return yyyy + '-' + mm + '-' + dd;
          },
          getNext7Days: function(now) {
              var sevenDays = [];
              var lastDay = now;
              for (var i = 0; i <= 7; i++) {
                    var nextDay = lastDay.setDate(lastDay.getDate() + 1);
                    lastDay = new Date(nextDay);
                    sevenDays.push(new Date(lastDay));
              }
              return sevenDays;
          },
          comingSoonOrder: function(self) {
              var startDay = new Date();
              var nextThursday = startDay;
              
              var sevenDays = self.getNext7Days(startDay);
              $.each(sevenDays, function (dayIndex, day) {
                    if(day.getDay() == 4){
                        nextThursday = day;
                        return false;
                    }
              });
              return self.formatDateYearMonthDay(nextThursday);
          },
        
          formatHour: function (hour) {
              return hour.substring(0, hour.length - 3);
          }
    }
};

