const alertComponent = {
     template: '#alert-component',
     mixins: [mixinUtilities,  mixinUrl],
     data: function () {
          return {
               show: false,
               message: undefined,
               code : undefined,
               is_inline: false,
               show_error: true,
               force_logoff : false,
               options : {
                    label_close: undefined,
                    label_confirm: undefined,
                    callback_close: undefined,
                    callback_confirm: undefined,
                    type: undefined,
                    status: undefined,
               }
          }
     },
     methods: {
          showLog: function(error_code, opt){
               var error = this.findInErrors(error_code);
               console.log("Err ", error_code, error.message);
          },
          showError: function(error_code, opt, userToken){
							 if (userToken) this.cancelOrder(function(){}, userToken);
               this.options = $.extend({}, BASE_CFG, opt || {show_error: true});
               // set code error and prefix
               var error = this.findInErrors(error_code);
               // override options
               this.options = $.extend(this.options, error || {});
               // call showAlert
               this.showAlert(error_code, this.options.message, this.options);
          },
          showAlert: function (code, message, opt) {
               this.options = $.extend({}, BASE_CFG, opt || {show_error: false});

               this.force_logoff = (this.options.jqXHR && (HTTP_ERROR_WITH_LOGGOFF.indexOf(this.options.jqXHR.status) != -1));

               if (this.force_logoff){
                    this.code = code;
                    this.message = "Su sesin ha expirado...";
                    this.setStatus(this.options.status);
                    this.show = true;
               }else{
                    this.code = code;
                    this.message = message;

                    this.is_inline = this.options.type == 'inline';
                    this.setStatus(this.options.status);

                    if (this.is_inline){
                         // if inline and target is defined -> append template in target
                         var target = $("#"+ this.options.target);
                         if (target) {
                              target.html("<div class='empty-list'><span class='code'>" + this.code +"</span><span class='message'>"+ this.message+ "</span></div>");
                         }
                    }else{
                         this.show = true;
                    }
               }
          },
          findInErrors: function(error_code){
               var splitted = error_code.split("-");
               var prefix_error = splitted[0];
               return errors[prefix_error];
          },
          fireClose: function () {
               this.show = false;
               if (this.force_logoff){
                    this.fireLogoff();
               }else{
                    if (this.options.callback_close) this.options.callback_close();
                    this.options.callback_close = undefined;
               }
          },
          fireConfirm: function () {
               this.show = false;
               if (this.options.callback_confirm) this.options.callback_confirm();
               this.options.callback_confirm = undefined;
          },
          fireLogoff: function(){
               var redirect_to = encodeURIComponent(window.location.href);
               this.logOff(redirect_to);
          },
          setStatus: function(state){
               var selected_state = STATES.filter(function(item){
                    return (item.id == state);
               });
               this.status = selected_state[0];
          },
          getClassConfirmButton: function(){
               // this class is used for know qty of buttons into div
               return this.status.id == 'confirm' ? 'confirm-button' : '';
          }
     }
};

