const autoLogout = {
	mixins: [md5Mixin],
  data: function () {
    return {
      
    };
  },
  mounted: function () {
		var path = window.location.pathname;
    if(this.containsAny(path, ["/orders"])){
			localStorage.setItem('nextLogout', this.md5(window.$modyo.membership_access_token));
		} else if (
			window.$modyo.membership_access_token &&
			localStorage.getItem('nextLogout') &&
			localStorage.getItem('nextLogout') == this.md5(window.$modyo.membership_access_token) &&
			this.containsAny(path, ["/compra", "/purchase","/purchasebarcode ", "/confiteria", "/concesiones", "alimentos-y-bebidas"]))
		{
			this.$refs.alertComponent.showError("VM03-99", {jqXHR: {status: 403}});
			localStorage.removeItem('nextLogout');
		} 
  },
  methods: {
    containsAny: function(str, substrings) {
			for (var i = 0; i != substrings.length; i++) {
				 var substring = substrings[i];
				 if (str.indexOf(substring) != - 1) {
					 return true;
				 }
			}
			return false; 
  	}
	}
};

