function startHeaderVueJs() {
     new Vue({
          delimiters: ['${', '}'],
          el: '#header',
          mixins: [mixinUrl, mixinCache, mixinUtilities, autoLogout],
          components: {
               'theatre-selector': theatreSelector,
						   'alert-component': alertComponent
          },
          data: {
               tag: undefined,
               alertPostMessage: undefined,
							 greenAlertPostMessage: undefined,
						   greenAlertUrl: "",
							site_url: site_url
          },
          watch: {
               loaded_theaters: {
                    handler: function (val, oldVal) {
                         if(this.params['tag']) {
                              this.tag = this.params['tag'];
                         } else {
                              this.setCurrentTheatre(null);
                              if(this.currentTheatre){
                                   this.tag = this.currentTheatre.id;
                              }
                         }
                         this.getTheatreAlertPost(this.tag);
											   this.getTheatreGreenAlertPost(this.tag);
                    }
               }
          },
          mounted: function () {
               this.params = this.getAllParams();
               this.getInCache('theatres_by_cities');
               this.responsiveMenu();
          },
          methods: {
               responsiveMenu: function() {
                    $(document).ready(function() {
                         $('.click-toggle-menu-mobile').on( "click", function(e) {
                              e.preventDefault();
                              if( $('.menu-panel-mobile').hasClass('show') ) {
                                   $('.menu-panel-mobile').removeClass('show');
                                   $('.overlay.click-toggle-menu-mobile').fadeOut(100);
                              } else {
                                   $('.menu-panel-mobile').addClass('show');
                                   $('.overlay.click-toggle-menu-mobile').fadeIn(200);
                              };
                         });
                    });
               },
               getUrlWithTag: function (url) {
                    var siteUrl = 'https://www.cinemark-peru.com';
                    url = siteUrl + url;
                    if(this.tag) {
                         return (url.indexOf("?") != -1) ? url + '&tag=' + this.tag : url + '?tag=' + this.tag;
                    } else {
                         return url;
                    }
               },
               addHoverFx: function () {
                    $('.dropdown-content-selector').hover(function() {
                         $('.dropbtn-selector').css('background-color', '#000');
                         $('.dropbtn-selector').css('border', '2px solid #000');
                         $('.dropbtn-selector').css('color', '#fff');
                    }, function() {
                         $('.dropbtn-selector').css('background-color', '');
                         $('.dropbtn-selector').css('border', '2px solid #a9a9a9');
                         $('.dropbtn-selector').css('color', '#7f7f7f');
                    });
               },
               getTheatreAlertPost: function(tag) {
                    var self = this;
                    var settings = {
                         "url": "/posts.json",
                         "method": "GET",
                         "data": {
                              "category": "alert",
                              "tags": tag,
                              "per_page": 1,
                              "order_by": "published_at",
                              "desc": true
                         }
                    };

                    $.ajax(settings).done(function(response) {
                         try {
                              self.alertPostMessage = (response.posts[0].excerpt != '') ? response.posts[0].excerpt : undefined;
                         } catch (e) {
                              console.log(".getTheatreAlertPost()");
                         }
												if (tag != "all") {
                         self.getTheatreAlertPost("all");
                    		}
                    });
               },
						   getTheatreGreenAlertPost: function(tag) {
									var self = this;
									var settings = {
										"url": self.resolvePath('posts', 'modyo2'),
										"method": "GET",
										"data": {
											"category": "green-alert",
											"tags": tag,
											"per_page": 1,
											"order_by": "published_at",
											"desc": true
										}
									};

									$.ajax(settings).done(function(response) {
										try {
											self.greenAlertPostMessage = (response.posts[0].excerpt != '') ? response.posts[0].excerpt : undefined;
											self.greenAlertUrl = (response.posts[0].description != '') ? response.posts[0].description : '';

										} catch (e) {
											console.log(".getTheatreAlertPost()");
										}
										if (tag != "all") {
											self.getTheatreGreenAlertPost("all");
										}
                    });
               },
							onSignup: function () {
								const { tagManagerDictionary } = GLOBAL_CONFIG;
								const { visitorType } = tagManagerDictionary;

								this.pushDataLayer([
									{
										pageCategory: tagManagerDictionary.signupHeader,
										visitorType: visitorType.signup,
									},
									{ event: "sign_up", method: "header" },
								]);

								window.location.href = site_url + "/registro";
							},
							onSignIn: function () {
								const { tagManagerDictionary } = GLOBAL_CONFIG;
								const { visitorType } = tagManagerDictionary;

								this.pushDataLayer([
									{
										pageCategory: tagManagerDictionary.loginHeader,
										visitorType: visitorType.login,
									},
									{ event: "login", method: "header" },
								]);

								window.location.href = site_url + "/me";
							},
          }
     });
}
$(document).ready(function() {
     startHeaderVueJs();
});

function startFooterVueJs() {
     new Vue({
          delimiters: ['${', '}'],
          el: '#footer',
          mixins: [mixinUrl, mixinCache],
          data: {
               tag: undefined
          },
          watch: {
               loaded_theaters: {
                    handler: function (val, oldVal) {
                         if(this.params['tag']) {
                              this.tag = this.params['tag'];
                         } else {
                              this.setCurrentTheatre(null);
                              if(this.currentTheatre){
                                   this.tag = this.currentTheatre.id;
                              }
                         }
                    }
               }
          },
          mounted: function () {
               this.params = this.getAllParams();
               this.getInCache('theatres_by_cities');
               this.accordionClick();
          },
          methods: {
               getUrlWithTag: function (url, hashtag) {
                    var siteUrl = 'https://www.cinemark-peru.com';
                    url = siteUrl + url;
                    if(this.tag) {
                         url = (url.includes("?")) ? url + '&tag=' + this.tag : url + '?tag=' + this.tag;
                         return (hashtag) ? url + hashtag : url;
                    } else {
                         return url;
                    }
               },
               accordionClick: function () {
                    $('#accordion').find('.accordion-toggle').click(function(){
                         //Expand or collapse this panel
                         $(this).next().slideToggle('fast');
                         //Hide the other panels
                         $(".accordion-content").not($(this).nxt()).slideUp('fast');
                    });
               },
               triggerTabs: function (id) {
                    $("#" + id).trigger("click");
                    $('html, body').animate({
                         scrollTop: 0
                    }, 0);
               }

          }
     });
}


$(document).ready(function() {
     startFooterVueJs();
});
